<?hh //strict


namespace adventofcode\five\one;

require __DIR__.'/../vendor/hh_autoload.php';
use namespace HH\Lib\{C, Str, Vec, Dict, Regex, Math};

<<__EntryPoint>>
async function run_five_one(): Awaitable<noreturn> {
	$test_string = "dabAcCaCBAcCcaDA";
	$actual_string =
		"";
	$reamining_count = find_remaining_count($actual_string);
	echo("$reamining_count\r\n");
	exit(0);
}

function find_remaining_count(string $s): int {
	$chars = Str\split($s, "");
	$remaining_chars = C\reduce(
		$chars,
		($stack, $c) ==> {
			if ((C\count($stack) === 0) || !isPair(C\last($stack), $c)) {
				$stack = Vec\concat($stack, vec[$c]); #aka push to the stack
			} else {
				$stack =
					Vec\take($stack, C\count($stack) - 1); #aka pop the stack
			}

			return $stack;
		},
		vec[],
	);
	return C\count($remaining_chars);
}

function isPair(?string $s1, ?string $s2): bool {
	if ($s1 === null || $s2 === null) {
		return false;
	}
	return Math\abs(\ord($s1) - \ord($s2)) === 32;
}
